  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Kirwin National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1957. The report begins by summarizing the weather conditions and water conditions
  during this period. Wildlife- including migratory birds, upland game birds, furbearers,
  predators, rodents, mammals, and raptors- is also covered. The Refuge development
  and maintenance section discusses physical developments, plantings, and collections
  and receipts. The public relations section of the report describes recreational
  uses, Refuge visitors, Refuge participation, and fishing. Items of interest and
  N-R forms are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
